üìçUbicado en una tierra con un bosque nativo que lo rodea en el interior de S√£o Paulo, el proyecto tiene el programa de la casa distribuido en una mezcla din√°mica de vol√∫menes con grandes luces y voladizos.

‚ñ™ El volumen inferior, revestido con granito r√∫stico y textura de pared, el sauna y las √°reas de spa, acomodan el espacio.

‚ñ™Por encima, aparece el volumen principal e intermedio; √©ste corresponde a la planta baja y al piso de acceso. En forma de l y con una textura de pared en bruto, se concentran los espacios sociales y de invitados, con una habitaci√≥n √≠ntima, tres suites para invitados, cocina, una parte superior con vista al bosque y una sala de estar de 20 metros con chimenea, terraza y asador.

